import React from "react";
import Meow from "./Meow";

const Timeline = ({ meows }) => {
  return (
    <div className="Timeline">
      <h2>{meows.length}</h2>
      {meows.map((meow, index) => {
        return <Meow key={index} {...meow} />;
      })}
    </div>
  );
};

export default Timeline;
